INSERT INTO `menu_router` VALUES ('node/add/article','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:7:\"article\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/article','Article','i18nstrings_title_callback','a:2:{i:0;s:26:\"nodetype:type:article:name\";i:1;s:7:\"Article\";}',6,'','An <em>article</em> is suitable for news items and press releases. By default, an <em>article</em> entry is automatically featured on the site front page, and provides the ability to post comments.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/book','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:4:\"book\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/book','Book page','i18nstrings_title_callback','a:2:{i:0;s:23:\"nodetype:type:book:name\";i:1;s:9:\"Book page\";}',6,'','A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/event','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:5:\"event\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/event','Event','i18nstrings_title_callback','a:2:{i:0;s:24:\"nodetype:type:event:name\";i:1;s:5:\"Event\";}',6,'','An <em>event</em> is suitable for any content that is strongly associated with a date, such as a meeting or a conference. Events are displayed in a calendar accessible from the main menu.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/image','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:5:\"image\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/image','Image','i18nstrings_title_callback','a:2:{i:0;s:24:\"nodetype:type:image:name\";i:1;s:5:\"Image\";}',6,'','An image (with thumbnail). This is ideal for publishing photographs or screenshots.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/page','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:4:\"page\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/page','Page','i18nstrings_title_callback','a:2:{i:0;s:23:\"nodetype:type:page:name\";i:1;s:4:\"Page\";}',6,'','A <em>page</em> is suitable for information that rarely changes, such as an \"About us\" section of a website or institutional information. By default, a <em>page</em> entry does not allow visitor comments.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/partner','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:7:\"partner\";}','i18ncontent_node_add','a:1:{i:0;i:2;}',7,3,'','node/add/partner','Partner','i18nstrings_title_callback','a:2:{i:0;s:26:\"nodetype:type:partner:name\";i:1;s:7:\"Partner\";}',6,'','A <em>partner</em> content type is suitable for creating and displaying partners of your project. <em>Partners</em> will be featured with their logo on the homepage, and you can give some more information and a link to their website.','',0,'modules/node/node.pages.inc');
