INSERT INTO `node_revisions` VALUES (579,579,1,'Add an article','<p>You can add an article for moving content on your website. Articles will be featured on the homepage, and can be put in the spotlight.<strong><br />\r\n</strong></p>','<p>You can add an article for moving content on your website. Articles will be featured on the homepage, and can be put in the spotlight.<strong><br />\r\n</strong></p>','',1245915007,1);
INSERT INTO `node_revisions` VALUES (580,580,1,'Add an event','<p>Events are like articles but have a date.&nbsp;You can also allow subscriptions on an event. In the following video we show you how to do all this.</p>','<p>Events are like articles but have a date.&nbsp;You can also allow subscriptions on an event. In the following video we show you how to do all this.</p>','',1245494543,1);
INSERT INTO `node_revisions` VALUES (582,582,1,'Configure your Satellite','','','',1245494684,1);
INSERT INTO `node_revisions` VALUES (583,583,1,'Setting your section and country','<p>Your section name, address and country are imported from the <a target=\"_blank\" href=\"http://galaxy.esn.org\">ESN Galaxy</a>, and configured locally in the <b>Satellite Configuration</b> page. If you wish to make updates in your address, for example, you need to:</p>\r\n<ol>\r\n    <li>login with your <b>ESN Identity</b> account on the <a target=\"_blank\" href=\"http://galaxy.esn.org\">ESN Galaxy</a> and change your section or country information.</li>\r\n    <li>reload your sections settings page to reflect the latest settings from ESN Identity. You can find your Satellite Configuration page in your personal menu under <u>Satellite Configuration</u></li>\r\n</ol>\r\n<p>Note that:</p>\r\n<ul>\r\n    <li>you need the right privileges to change your section or country information. Only the President of your section, the National Representative of your country and the Web Projects Administrator of ESN International can change that information.</li>\r\n    <li>you need to wait 8 hours in orders for the changes to take effect, or you can run <b>cron</b> to reflect the latest changes of the ESN Galaxy immediately on your Satellite. You can run cron by going to <a href=\"cron.php\">cron.php</a></li>\r\n</ul>','<p>Your section name, address and country are imported from the <a target=\"_blank\" href=\"http://galaxy.esn.org\">ESN Galaxy</a>, and configured locally in the <b>Satellite Configuration</b> page. If you wish to make updates in your address, for example, you need to:</p>','',1245914746,1);
INSERT INTO `node_revisions` VALUES (584,584,1,'Interact with Facebook','<p><a href=\"http://www.facebook.com\">Facebook</a> is a popular social platform, and out of the box, Satellite provides you with two types of interaction:</p>\r\n<ul>\r\n    <li>Link your Satellite to your <a href=\"http://www.facebook.com/advertising/?pages\">Facebook page</a> or Facebook group in the Satellite Configuration page. A link to Facebook will be put on the homepage of the Satellite, in the &quot;Follow us on...&quot; block.</li>\r\n    <li>Allow users from Facebook to login to your Satellite, using <a href=\"http://www.facebook.com/help.php?page=730\">Facebook Connect</a>.This will require the setup and configuration of a module shipped within Satellite, and the creation of a developer application on Facebook. To learn how to do this, check out the video.</li>\r\n</ul>\r\n<p>Useful links:</p>\r\n<ul>\r\n    <li><a href=\"http://mashable.com/2009/05/27/facebook-page-vs-group/\">Learn more about Facebook pages and groups</a></li>\r\n    <li><a href=\"http://www.facebook.com/help.php?page=730\">Learn more about Facebook Connect</a></li>\r\n</ul>\r\n<p>&nbsp;</p>','<p><a href=\"http://www.facebook.com\">Facebook</a> is a popular social platform, and out of the box, Satellite provides you with two types of interaction:</p>','',1245914786,1);
INSERT INTO `node_revisions` VALUES (585,585,1,'Interact with Twitter','<p>First of all, <a href=\"http://www.scientificamerican.com/blog/60-second-science/post.cfm?id=twitter-what-is-it-good-for-2009-02-13\">what is Twitter</a>? Our suggestion: make a Twitter account for your section and keep in touch with people through &quot;micro-blogging&quot;, announcing the latest news and changes in programmes on Twitter.</p>\r\n<p>And guess what, you can also have interaction with Twitter on your Satellite, in two ways:</p>\r\n<ul>\r\n    <li>Link your Satellite to your Twitter account in the Configuration page. A link to your Twitter will be put on the homepage of the Satellite, in the &quot;Follow us on...&quot; block, so your visitors can easily track you down on Twitter.</li>\r\n    <li>Post every article, event, etc. directly on your Twitter account. This requires the setup and configuration of a Drupal module shipped with your Satellite. <a href=\"http://gotdrupal.com/videos/drupal-twitter-module\">Check out this video if you want to learn how.</a></li>\r\n</ul>','<p>First of all, <a href=\"http://www.scientificamerican.com/blog/60-second-science/post.cfm?id=twitter-what-is-it-good-for-2009-02-13\">what is Twitter</a>? Our suggestion: make a Twitter account for your section and keep in touch with people through &quot;micro-blogging&quot;, announcing the latest news and changes in programmes on Twitter.</p>\r\n<p>And guess what, you can also have interaction with Twitter on your Satellite, in two ways:</p>','',1245914816,1);
