INSERT INTO `node_revisions` VALUES (587,587,1,'logo_facebook.jpg','','','',1245498484,0);
INSERT INTO `node_revisions` VALUES (588,588,1,'Administer your Satellite','<p>ESN&nbsp;Satellite is built on <a href=\"http://www.drupal.org\">Drupal</a>, a powerful open-source content management system. If you want to know more about why we believe Drupal is one of the most powerful systems to date, read the <a href=\"http://acquia.com/what-is-drupal\">&quot;What is Drupal&quot;</a> guide maintained by <a href=\"http://www.acquia.com\">Acquia</a>.</p>\r\n<p>There are no limitations in administering your Satellite, and with over <a href=\"http://drupal.org/project/modules\">4000 modules available</a>, you can easily extend the functionality of your Satellite. And with the new <a href=\"../../../admin/plugin_manager/\">Plugin Manager</a>, you can download and install modules from within your Satellite.</p>\r\n<p>Here are a couple of links if you want to learn more about Drupal:</p>\r\n<ul>\r\n    <li><a href=\"http://learnbythedrop.com/gettingstarted\">Learn by the Drop: Getting started with Drupal</a></li>\r\n    <li><a href=\"http://gotdrupal.com/\">GotDrupal: An excellent source of videos guiding you through using Views, CCK and other Drupal modules</a></li>\r\n    <li><a href=\"http://drupal.org/node/508\">A guide for developing your own Drupal modules</a></li>\r\n</ul>\r\n<p>And here some basic maintenance tips:</p>\r\n<ul>\r\n    <li>In order to <strong>backup</strong> your site it is not enough to copy all the files: configuration (and all site content) is stored in the database, so you will need to save both the files and the database.</li>\r\n    <li>It is important to periodically check for <strong>security updates</strong> of Drupal and the modules. You can do this through the Reports menu, but Drupal will do it automatically when you login. To upgrade Drupal, follow the guidelines at <a class=\"ext-link\" href=\"http://drupal.org/upgrade/\"><span class=\"icon\">http://drupal.org/upgrade/</span></a>; to upgrade modules, just remember that all contributed modules are in the profiles/satellite/modules subdirectory.</li>\r\n    <li>You might find <a class=\"ext-link\" href=\"http://drupal.org/project/drush\"><span class=\"icon\">Drush</span></a> very handy if you have command-line access to your server.</li>\r\n</ul>\r\n<p>&nbsp;</p>','<p>ESN&nbsp;Satellite is built on <a href=\"http://www.drupal.org\">Drupal</a>, a powerful open-source content management system. If you want to know more about why we believe Drupal is one of the most powerful systems to date, read the <a href=\"http://acquia.com/what-is-drupal\">&quot;What is Drupal&quot;</a> guide maintained by <a href=\"http://www.acquia.com\">Acquia</a>.</p>','',1245912508,1);
INSERT INTO `node_revisions` VALUES (589,589,1,'googlegroups_logo.gif','','','',1245500252,0);
INSERT INTO `node_revisions` VALUES (590,590,1,'Find support','<p>For all your questions regarding ESN&nbsp;Satellite, please mail the <a href=\"http://groups.google.com/group/esn-satellite\">ESN&nbsp;Satellite Google Groups</a>, which contains over 100 passionate ESN&nbsp;Satellite users and developers.</p>\r\n<div class=\"warning\">Do you wish to join the <strong>ESN Webteam,</strong> and help out with the ESN Satellite and other ESN web projects? You could help us out with <strong>coding</strong>, writing <strong>documentation</strong>, <strong>PR</strong>, or whatever you wish to get involved with. Drop us an email at <a href=\"mailto:webteam@esn.org?subject=I%20wish%20to%20join%20the%20ESN%20Webteam&amp;body=I%20want%20to%20help%20out%20with%20...\">webteam@esn.org</a>.</div>','<p>For all your questions regarding ESN&nbsp;Satellite, please mail the <a href=\"http://groups.google.com/group/esn-satellite\">ESN&nbsp;Satellite Google Groups</a>, which contains over 100 passionate ESN&nbsp;Satellite users and developers.</p>','',1246435912,1);
INSERT INTO `node_revisions` VALUES (591,591,1,'Add external media.jpg','','','',1245575563,0);
INSERT INTO `node_revisions` VALUES (593,593,1,'Provide inline feedback ','<div class=\"warning\">Do you wish to join the <strong>ESN Webteam,</strong> and help out with the ESN Satellite and other ESN web projects? You could help us out with <strong>coding</strong>, writing <strong>documentation</strong>, <strong>PR</strong>, or whatever you wish to get involved with. Drop us an email at <a href=\"mailto:webteam@esn.org?subject=I%20wish%20to%20join%20the%20ESN%20Webteam&amp;body=I%20want%20to%20help%20out%20with%20...\">webteam@esn.org</a>.</div>\r\n<p>&nbsp;</p>\r\n<p>You can provide feedback when you are logged in to the website, for example, to make a suggestion on the page you are browsing, or to report a bug.</p>\r\n<p>Your feedback will be sent to:</p>\r\n<ul>\r\n    <li>an internal feedback system managed under Reports &gt; Feedback messages</li>\r\n    <li>to the mail addresses of all the users with the editor role on your website</li>\r\n    <li>to <em>satellite@esn.org</em>, where it will be reviewed by the ESN&nbsp;Webteam. If your feedback message is relevant to the ESN&nbsp;Satellite community, it will be published to the ESN&nbsp;Satellite Google Groups, so the community can react on it</li>\r\n</ul>\r\n<p>Internally, all those actions are managed by the <a href=\"http://drupal.org/project/rules\">Rules module</a>. If you want, you can configure your own actions to be executed when a feedback message is posted (eg send it to the admin email address) by configuring the appropriate rules. Make sure to enable the &quot;Rules Administration UI&quot; module first.</p>','<div class=\"warning\">Do you wish to join the <strong>ESN Webteam,</strong> and help out with the ESN Satellite and other ESN web projects? You could help us out with <strong>coding</strong>, writing <strong>documentation</strong>, <strong>PR</strong>, or whatever you wish to get involved with. Drop us an email at <a href=\"mailto:webteam@esn.org?subject=I%20wish%20to%20join%20the%20ESN%20Webteam&amp;body=I%20want%20to%20help%20out%20with%20...\">webteam@esn.org</a>.</div>\r\n<p>&nbsp;</p>','',1246435988,1);
